member.example:
 The following example creates a TabControlAdv with one TabPageAdv object. The constructor
instantiates tabControl1. Use the Syncfusion.Windows.Forms.Tools namespace for this example.
 public Form1() { this.tabPage1 = new TabPageAdv(); // Invokes the TabControlAdv()
constructor to create the tabControl1 object. this.tabControl1 = new TabControlAdv();
this.tabControl1.Controls.Add(tabPage1); this.Controls.Add(tabControl1); } 
 Public Sub New() Me.tabPage1 = New TabPageAdv() ' Invokes the TabControlAdv()
constructor to create the tabControl1 object. Me.tabControl1 = New TabControlAdv()
Me.tabControl1.Controls.Add(tabPage1) Me.Controls.Add(tabControl1) End Sub 'New
